        "mantananiIsland":
            MessageLookupByLibrary.simpleMessage("Pulau Mantanani"),
        "mantananiIslandContent": MessageLookupByLibrary.simpleMessage(
            "Berdekatan dengan Kota Belud di Sabah, Pulau Mantanani menawarkan beberapa lokasi menyelam terbaik di Borneo. Snorkeler dan penyelam datang untuk berenang dengan kuda laut dan ikan pari dalam lawatan sehari dari ibu kota. Orang yang mempunyai sijil menyelam boleh menyelam di lebih daripada 20 lokasi, termasuk tiga bangkai kapal. Selepas beberapa jam di Laut China Selatan, berehat dan nikmati matahari terbenam Borneo yang terkenal di pantai berpasir putih yang bersih."),
