        "mossyForest": MessageLookupByLibrary.simpleMessage(
            "Hutan Lumut, Cameron Highlands"),
        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "Hutan Lumut adalah ekosistem semula jadi yang hanya tumbuh di ketinggian yang lebih tinggi di Cameron Highlands dan kawasan pergunungan lain di Malaysia. Awan rendah yang dibawa angin menyelubungi pokok-pokok dengan kabut dan kelembapan berterusan, menyediakan habitat sempurna untuk lumut, pakis, liken, dan orkid. Hutan tropika lembap ini juga menjadi tempat perlindungan bagi pelbagai spesies gunung, termasuk rama-rama, tikus, katak, burung, dan mamalia yang hanya terdapat di iklim sejuk ini."),
        "mountPulai":
            MessageLookupByLibrary.simpleMessage("Gunung Pulai, Johor"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "Gunung Pulai ialah gunung setinggi 654 meter di Johor, Semenanjung Malaysia. Disebabkan lokasinya yang berdekatan dan mudah diakses, ia menjadi destinasi mendaki yang popular bagi penduduk Singapura dan tempatan. Puncak Gunung Pulai tidak dibuka kepada orang awam kerana ia dikawal oleh tentera dan terdapat dua menara komunikasi. Gunung Pulai mempunyai laluan bulatan sepanjang 14.3 kilometer berhampiran Kulai, Johor, dengan air terjun dan tahap kesukaran tertentu. Laluan ini juga digunakan untuk berkemah, berbasikal, berlari, dan berjalan di alam semula jadi."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "Transit Aliran Massa (MRT) dibahagikan kepada dua laluan; yang pertama ialah laluan Sungai Buloh-Kajang sepanjang 51km dengan 31 stesen di sepanjang laluan ini. Semua stesen mula beroperasi pada pukul 6.00 pagi setiap hari. Waktu penutupan berbeza bergantung kepada stesen masing-masing. Perjalanan tunggal berharga dari RM1.20 ke atas. Talian bantuan: 1800-82-6868"),
