            "Nasi Lemak adalah nasi harum yang dimasak dalam santan dan daun pandan, disajikan dengan sambal pedas, timun, ikan bilis goreng, telur dan kacang goreng. Ia paling enak dimakan bersama secawan teh tarik panas. Kebanyakan kedai atau gerai juga menyediakan pilihan tambahan seperti rendang ayam atau daging, ayam goreng, sambal udang dan banyak lagi."),
