        "ourCompanyDescription": MessageLookupByLibrary.simpleMessage(
            "KL The Guide adalah buku panduan perjalanan suku tahunan, pertama kali diterbitkan pada Ogos 2007. Kami adalah buku panduan perjalanan percuma yang membantu pelancong merancang perjalanan mereka di sekitar ibu kota Malaysia, Kuala Lumpur. KL The Guide merangkumi tip perjalanan, tempat untuk diterokai, lokasi mesra kanak-kanak, hotel, dan banyak lagi. Dengan KL The Guide, navigasi bandar menjadi lebih mudah."),
