        "pangkorIsland": MessageLookupByLibrary.simpleMessage("Pulau Pangkor"),
        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "Lihatlah Pulau Pangkor jika anda mencari tempat yang tiada pelancong. Terletak berhampiran pantai Perak, pulau ini menawarkan pantai kosong, air yang bersih dan hutan tebal di tengahnya. Pengunjung menghargai peluang untuk berjemur di bawah pokok kelapa tanpa ada orang lain. Selain itu, kunjungi kubu Belanda kolonial dan ambil gambar di jeti kayu tradisional."),
        "panoramaHill": MessageLookupByLibrary.simpleMessage(
            "Bukit Panorama, Sungai Lembing"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "Bukit Panorama adalah sebuah bukit di Sungai Lembing, 45 kilometer di barat laut Kuantan. Dengan ketinggian 271 meter, hanya ada satu laluan pendakian ke atas. Mulakan dari kaki tangga dan terus mendaki ke atas. Ciri utama laluan ini ialah tangga dengan pemegang; hanya beberapa bahagian pendek yang tidak mempunyai tangga. Apabila sampai di puncak bukit, anda akan dapat melihat pemandangan panorama bandar sekeliling. Pendaki biasanya mengambil masa antara 30 hingga 45 minit untuk mencapai puncak Bukit Panorama."),
        "parks": MessageLookupByLibrary.simpleMessage("Kafe"),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "Taman Negara Pulau Pinang, Pulau Pinang"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "Ini adalah taman negara terkecil di Malaysia, dengan keluasan 23 kilometer persegi, tetapi hutan pantainya adalah habitat kepada monyet daun perak, lemur terbang, kucing belang, dan pelbagai jenis cicak, amfibia, dan reptilia. Aktiviti seperti berjalan di hutan dan menaiki bot ke pantai berpasir emas yang tenang akan mengisi hari anda dengan selesa. Terdapat dua laluan utama di taman ini: satu yang membawa anda sepanjang pantai ke Pantai Monyet, dan satu lagi yang membawa anda merentasi bukit melalui hutan ke pantai yang lebih terpencil, di mana terletaknya Suaka Penyu."),
