        "pulauLangkawi": MessageLookupByLibrary.simpleMessage("Pulau Langkawi"),
        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "Pulau Langkawi adalah rumah kepada beberapa pantai terbaik di Semenanjung Malaysia. Pulau ini menggabungkan gunung dan bakau dengan garis pantai yang berkilauan. Buat perjalanan sehari ke Pulau Dayang Bunting yang disenaraikan oleh UNESCO, beri makan helang, dan lihat monyet berenang untuk mencari makanan. Atau, bawa tuala anda dan berjemur di Pantai Cenang sebelum menikmati minuman di bar tepi pantai. Satu lagi kelebihan adalah pulau ini bebas cukai, jangan ragu untuk berbelanja!"),
        "pulauRedang": MessageLookupByLibrary.simpleMessage("Pulau Redang"),
        "pulauRedangContent": MessageLookupByLibrary.simpleMessage(
            "Salah satu pulau terbesar di pantai timur Malaysia, Pulau Redang terkenal dengan airnya yang jernih dan pantai berpasir putih. Ia adalah salah satu dari sembilan pulau yang membentuk taman perlindungan marin yang menawarkan peluang kepada pelancong untuk snorkeling dan menyelam. Pantai ini penuh dengan pasir putih yang lembut. Anda dapat melihat batu karang dan ikan hanya beberapa meter dari pantai."),
        "rapidKLBusDescription": MessageLookupByLibrary.simpleMessage(
            "Bas RapidKL sering dilihat di kebanyakan stesen kereta api dan biasanya berfungsi sebagai pengangkutan transit untuk penumpang terus ke destinasi pilihan mereka. Setiap perjalanan bas boleh menelan kos sehingga RM5.00 yang boleh dibayar menggunakan wang tunai tepat atau melalui kad Touch n’ Go semasa masuk dan keluar. Talian bantuan: 03-7885 2585"),
