        "sevenWellsContent": MessageLookupByLibrary.simpleMessage(
            "Air Terjun Telaga Tujuh, juga dikenali sebagai Jalan Telaga Tujuh, terletak kira-kira 20 minit berjalan kaki dari Langkawi Sky Bridge yang terkenal dan merupakan salah satu tarikan semula jadi yang paling indah di pulau ini. Air terjun ini mengalir dari Gunung Mat Cincang, puncak kedua tertinggi di Langkawi, dan popular di kalangan pelancong dan penduduk tempatan. Jatuhan menegak penuh adalah setinggi 91 meter, tetapi hanya sebahagian kecil yang dapat dilihat dari bawah. Menurut legenda, air terjun ini adalah rumah kepada pari-pari dan airnya mempunyai khasiat menenangkan. Air terjun ini kelihatan ajaib kerana dikelilingi oleh alam semula jadi yang kaya dengan flora dan fauna."),
