        "sipadanIsland": MessageLookupByLibrary.simpleMessage("Pulau Sipadan"),
        "sipadanIslandContent": MessageLookupByLibrary.simpleMessage(
            "Pulau kecil berhampiran Semporna di Sabah ini tergolong antara kawasan menyelam terbaik di dunia. Anda tidak akan menemukan penginapan atau banyak kemudahan di sekitar pulau. Disarankan untuk mengikuti lawatan semasa perjalanan anda. Penerbangan dari Kota Kinabalu ke Semporna dan perjalanan bot satu jam ke penyu dan kawanan barracuda sangat berbaloi. Selepas memperoleh status dilindungi pada tahun 2002, lebih sedikit pelancong yang mendapat permit untuk melawat puncak batu kapur."),
