        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "Malaysia dikurniakan banyak hutan hujan yang menempatkan air terjun yang menakjubkan. Air Terjun Pelangi terletak kira-kira 45 kilometer di barat laut Kuantan, Semenanjung Malaysia, di pekan Sungai Lembing. Setiap pagi antara jam 9 hingga 10 pagi, matahari memancar pada air yang jatuh di dasar air terjun, menghasilkan pelangi yang indah. Orang ramai dari seluruh dunia melakukan perjalanan selama satu setengah jam hanya untuk melihat keindahan alam semula jadi ini. Air Terjun Pelangi adalah air terjun besar yang tersembunyi di kawasan hutan hujan Sungai Lembing, yang boleh diakses dengan kenderaan 4WD dan mendaki."),
        "sungaiPisangContent": MessageLookupByLibrary.simpleMessage(
            "Air Terjun Pisang adalah laluan pergi dan balik sejauh 3.1 kilometer dengan air terjun yang terletak berhampiran Gombak, Selangor, Malaysia. Laluan ini sesuai untuk pendaki dengan pelbagai tahap kemahiran. Laluan ini dibuka sepanjang tahun dan sering digunakan untuk berkemah, berbasikal, dan memerhati burung. Di puncak air terjun, terdapat beberapa lokasi yang sesuai untuk berkelah dan berkemah. Ia adalah pendakian santai yang memerlukan anda menyeberangi air terjun, jadi bersedialah untuk kasut yang basah."),
